(27920, 84012, 2775, 4, '綻放的微笑', '上班族大多都很悶，所以我們需要快樂的音符，這首曲子，是為了一解上班族的悶而寫的。', '2010-09-18 00:00:00', 2010, 0, 1, 7, '', '', 225, '', '', '', '', '', '', 0, 1, 0, '2010-09-18 15:55:31', '2015-03-12 13:43:44', '0000-00-00 00:00:00'),
(27921, 84012, 2775, 2, '失落的美感', '歌曲的創作背景，乃是看到身邊的一些朋友、家人，他們為了夢想，努力地在提升自己，但過程中，總是碰到許多無法掌握的不如人意，在情緒來襲的當下，我們會難過、會傷心，可是，跌倒和受傷，也是美麗故事的一部份啊！！\r\n\r\n更何況，就是因為故事中，我們所遇見的那些傷痛，會讓我們更珍惜，自己所擁有的一切，能了解並接受這些，就可以換個角度，欣賞那些不如人意，也有一種失落的美，而這樣的心情，讓我譜出了這首歌。', '2010-09-18 00:00:00', 2010, 0, 1, 7, '', '', 213, '', '', '', '', '', '', 0, 1, 0, '2010-09-18 15:58:21', '2015-03-12 13:43:44', '0000-00-00 00:00:00'),
(27922, 84012, 2776, 1, '­音符等等我', '搭配數種獨特的電子樂音，用輕快的曲風，讓活力動起來。 ', '2010-09-18 00:00:00', 2010, 0, 1, 3, '', '', 194, '', '', '', '', '', '', 0, 1, 0, '2010-09-18 16:03:02', '2015-03-12 13:43:44', '0000-00-00 00:00:00'),
(27923, 84012, 2777, 1, '用眼神說道別', '單曲專輯\r\n用大提琴、鋼琴，在編曲上試著呈現，彼此在對話，像是在道別。 ', '2010-09-18 00:00:00', 2010, 0, 1, 7, '', '', 206, '', '', '', '', '', '', 0, 1, 0, '2010-09-18 16:07:44', '2015-03-12 13:43:44', '0000-00-00 00:00:00'),
