(27929, 84057, 0, 1, 'Darkness Corner (Demo)', '所有的事物\r\n\r\n都有著很多存在的方式\r\n\r\n悲傷也是\r\n\r\n隨著音符上升與滑落\r\n\r\n隨著聲音的傳達\r\n\r\n隨著你的聆聽\r\n\r\n存在著\r\n \r\n疼痛著\r\n\r\n感受著\r\n\r\n悲傷著\r\n\r\n', '2011-09-19 00:00:00', 2010, 0, 1, 5, '淚水沖刷夜晚的愚昧 想像著你的美\r\n祈禱著所謂的心跳聲 隱藏我的衝動\r\n獨自一人躲在黑暗角落 忍著愛的幻影\r\n\r\n此刻 無法抑制 那胸口 那疼痛\r\n如果可以訴說我的愛 我的心\r\n這首歌 為了你而唱 盤旋在和弦\r\n到最後 還是讓你去翱翔 不打擾你\r\n\r\n\r\n', '', 353, '', '鬼貓', '鬼貓', '鬼貓', '', '', 0, 0, 1, '2010-09-19 13:20:39', '2013-10-07 17:17:02', '0000-00-00 00:00:00'),
(27930, 84057, 0, 1, '華麗早報生 (demo)', '無論如何\r\n想追求屬於自己的夢\r\n自己的歡笑與驕傲\r\n\r\n雖然現實\r\n常常讓人覺得無力\r\n\r\n但是 我將持續向前奔跑\r\n\r\n', '2010-09-19 00:00:00', 2009, 0, 1, 4, '才進入了夜晚 還沒狂歡就要離散\r\n凌晨一片昏暗 引擎吹響些許不安\r\n每天都是早班 每天早上送報問安\r\n\r\n也不是沒有所謂的驕傲\r\n也不是沒有所謂的歡笑\r\n熟記華麗的路線\r\n仰起了專業的微笑\r\n永遠面向著那前方\r\n\r\n雖然不能參加夜唱 得轉戰早唱\r\n四點三十準時抵達 將報紙疊好\r\n\r\n也不是沒有所謂的驕傲\r\n也不是沒有所謂的歡笑\r\n閃電般的套廣告\r\n神技般的鑽小通道\r\n傾盆大雨淹沒了視線\r\n吃個早餐打起了精神\r\n迎向了下一個你\r\n將新聞送到你手裡\r\n永遠面向著那前方\r\n\r\n\r\n', '', 251, '', '鬼貓', '鬼貓', '鬼貓', '', '', 0, 0, 1, '2010-09-19 13:23:43', '2013-10-07 17:17:02', '0000-00-00 00:00:00'),
(27931, 84057, 0, 1, 'My Only (Demo)', '祝福\r\n\r\n你你你你你你你你你你你你你你你你你你你你你你你你你你你你你你你你你你你你你你你你你你你你你你你你你你你你你你你你你你你你你你你你你你你你你你你你你你你你你你你你你你你你你你你你你你你你你你你你你你你\r\n\r\n給我永浴愛河吧!!\r\n\r\n', '2010-09-19 00:00:00', 2009, 0, 1, 4, '天無邊無際\r\n海剝落的夜空\r\n永遠說的話語\r\nForever Loving You\r\n\r\n河流旁的嘻戲\r\n緊緊相扣的回憶\r\nBaby listen to me\r\nForever Loving You\r\n\r\n點綴了迷失了的心不逃避\r\n守護我們堅信的愛\r\n\r\nYou are my only one, trust love.\r\n偶然相遇的妳我 吸引著目光 微妙微笑\r\nYou are my only love. 地球上\r\n時光奔向了明天 我們都別忘 一起到老\r\n\r\n\r\n', '', 257, '', '鬼貓', '鬼貓', '鬼貓', '', '', 0, 0, 1, '2010-09-19 13:27:29', '2013-10-07 17:17:02', '0000-00-00 00:00:00'),
(27932, 84057, 0, 1, '倒影 (Demo)', '隨著日子一天一天過去\r\n\r\n在我們沒有察覺到的時候\r\n\r\n或許\r\n\r\n一切就將要結束了\r\n\r\n或許\r\n\r\n我們只能選擇用力的抓住此刻的每一個事物\r\n\r\n或許\r\n\r\n我們更該珍惜一切\r\n\r\n', '2010-09-19 00:00:00', 2010, 0, 1, 4, '黑白的倒影 預告了鮮紅的末日\r\n純白的意志 覆蓋了遙遠的旗幟\r\n空白的劇本 透露了失去的理智\r\n\r\n一個人迎戰 兩個人擁有的孤單\r\n不會在逝去瞬間吟唱出哀悽的故事\r\n一個人想像 一個人擁有的悲傷\r\n此刻傾聽大雨的歌聲忘記了逃跑\r\n\r\n深夜裡 面對自己\r\n在心底 相信過去\r\n讓時間 緩慢的死去\r\n\r\n\r\n', '', 305, '', '鬼貓', '鬼貓', '鬼貓', '', '', 0, 0, 1, '2010-09-19 13:31:18', '2013-10-07 17:17:02', '0000-00-00 00:00:00'),
(27933, 84057, 0, 1, 'Tommorow (Demo)', '如果曾經深愛\r\n\r\n曾經受了傷\r\n\r\n曾經落了淚\r\n\r\n即使用盡全力\r\n\r\n什麼也沒留下\r\n\r\n也沒有得到\r\n\r\n但是\r\n\r\n故事才正要開始\r\n\r\n', '2010-09-19 00:00:00', 2010, 0, 1, 4, '別說你愛我\r\n別給我承諾\r\n我一人渡過\r\n別讓我回頭\r\n\r\n遠離了沉默\r\n看清了盡頭\r\n看見了自由\r\n記憶裡停留\r\n\r\n剩下殘留在眼角餘溫\r\n伴我獨自在深夜入眠\r\n或許明天讓我們一起\r\n依偎著傷痕將誓言碎裂\r\n\r\n天亮之前將所有訴說\r\n天黑之前將不再低頭\r\n\r\n\r\n', '', 267, '', '鬼貓', '鬼貓', '鬼貓', '', '', 0, 0, 1, '2010-09-19 13:34:19', '2013-10-07 17:17:02', '0000-00-00 00:00:00'),
(27934, 84057, 0, 1, 'Lonely (Demo)', '覺得\r\n\r\n人很難真的珍惜\r\n\r\n或許\r\n\r\n比起很多的堅持\r\n\r\n比起很多的利益\r\n\r\n一切事物最終\r\n\r\n還是會回到它原本的模樣\r\n\r\n將是........比什麼都還要單純的吧\r\n', '2010-09-19 00:00:00', 2009, 0, 1, 4, '夜晚的高歌藏住了心底的訣別\r\n瘋狂的顫抖是這瞬間的愚昧\r\n你無聲低頭念著失去的曾經是非\r\n微笑著落淚 不能夠解放明天\r\n\r\nThis time for you\r\nOh! Please don’t let me feel so lonely\r\n我迷失了屬於我們的回憶\r\n已經沒有力氣 沒有勇氣\r\nIt’s time for me\r\nOh! Please don’t let you feel so lonely\r\n我迷失了屬於我們的回憶\r\n已經沒有力氣 沒有勇氣\r\n\r\n\r\n', '', 253, '', '鬼貓', '鬼貓', '鬼貓', '', '', 0, 0, 1, '2010-09-19 13:37:56', '2013-10-07 17:17:02', '0000-00-00 00:00:00'),
(27935, 84057, 0, 1, '蝴蝶 (Demo)', '分離\r\n\r\n無數的分離\r\n\r\n在對我的世界\r\n\r\n述說些什麼......\r\n\r\n', '2010-09-19 00:00:00', 2010, 0, 1, 4, '生鏽的琴弦所彈奏出來的旋律\r\n不知怎麼地竟然像是哭泣\r\n早已崩壞的你我就像是那隻鳥\r\n怎麼飛也回不到那些曾經\r\n                                                                                \r\n若無其事的逞強\r\n                                                                                \r\n我想要述說這一瞬間\r\n痛浮現腦海無限蔓延\r\n                                                                                \r\n即使擁有著堅強的信念走向前\r\n還是難以去原諒那些傷痛\r\n或許有一天該學會像別人一樣\r\n漠視了自己內心深處的衝動\r\n                                                                                \r\n我想要述說這一瞬間\r\n痛浮現腦海無限蔓延\r\n用盡了全力無法挽回\r\n你帶著哀傷化做蝴蝶\r\n', '', 226, '', '鬼貓', '鬼貓', '鬼貓', '', '', 0, 0, 1, '2010-09-19 19:39:53', '2013-10-07 17:17:02', '0000-00-00 00:00:00'),
