(27944, 77509, 0, 1, '深愛', '', '2010-07-01 00:00:00', 0000, 20, 0, 7, '深愛\r\n\r\n他的眼神將你佔有 他的愛情把你傷透 \r\n太多理由 安慰了你的寬容 \r\n\r\n清晨一場大雨過後 你的堅強終於崩落\r\n我只能夠 默默的心痛\r\n\r\n想帶你遠走 伸出手以後你卻選擇停留\r\n那麼多的冷漠 深愛著的執著\r\n\r\n*\r\n就讓我來為你擋風  趕走所有寂寞\r\n不在乎擁有 愛傻了不回頭\r\n\r\n就讓我來為你承受 吞掉所有寂寞\r\n情願被揮霍 換你的笑容', '', 248, '', '楊忠盛(綠豆)', '楊忠盛(綠豆)', '換日線樂團dateline', '換日線樂團dateline', '', 0, 0, 1, '2010-09-20 22:29:09', '2013-10-07 17:17:02', '0000-00-00 00:00:00'),
(27945, 77509, 0, 1, '柏林圍牆', '', '2010-07-01 00:00:00', 0000, 20, 0, 8, '想你的時候 一個人的沉默 安靜的拼湊 我們為何不同\r\n\r\n你衝動 我穩重 你想走 我不動 到最後 \r\n\r\n相同理由 不一樣的夢\r\n\r\n*\r\n推翻吧 柏林圍牆 隔絕了我們之間 最後的牽掛\r\n\r\n毀掉吧 柏林圍牆 多盼望你的臉龐 溫柔而優雅\r\n\r\nI  missing you around  \r\n\r\nI  missing you around  \r\n\r\nI  missing you around  \r\n\r\nI  missing you around  \r\n\r\n太多的蹉跎 紛爭多過包容 都不在開口 冷漠分割你我\r\n\r\n傷透那一吋吋深的心窩 在多挽留都無法停止劇終\r\n\r\n淚已落 你遠走\r\n\r\n*\r\n推翻吧 柏林圍牆 隔絕了我們之間 最後的牽掛\r\n\r\n毀掉吧 柏林圍牆 多盼望你的臉龐 溫柔而優雅\r\n\r\n推翻吧\r\n\r\n推翻吧\r\n\r\nI  missing you around  \r\n\r\nI  missing you around  \r\n\r\nI  missing you around  \r\n\r\nI  missing you around\r\n\r\n\r\n\r\n', '', 251, '', '楊忠盛(綠豆)', '楊忠盛(綠豆)', '換日線樂團dateline', '換日線樂團dateline', '', 0, 1, 0, '2010-09-20 22:29:59', '2015-03-12 13:43:44', '0000-00-00 00:00:00'),
