(28070, 84309, 0, 1, '剛剛好 Demo', '', '2010-09-24 00:00:00', 2010, 0, 1, 7, '2009 的狗屁叨糟 沒人想要\r\n2010 在眾人眼中 期盼來到\r\n煙火開花那一瞬間   劃破成幾道? \r\n熱鬧看不到  才過了幾秒\r\n\r\n又一個破曉\r\n\r\n車子照常跑  煩惱仍在新的國度繞\r\n鑰匙一直掉  大門可以開的還在找\r\n \r\n我們每天吃飽飽  整天總是在哭夭\r\n怎麼看怎麼好笑  其實也不壞不好\r\n \r\n生活目前 脫序邊緣  順眼不順眼 \r\n想不想改變?\r\n怎樣尖叫 試圖尖叫 都像被噎到\r\n還是說其實不壞也不好\r\n怎麼逃 都逃脫不了\r\n了不了 料不料的到?\r\n世代在變也差不了多少\r\n\r\n人還在逃 煩惱還在過去沒完了\r\n火仍燃燒 一把野火依然沒滅掉\r\n有多荒謬 熱鍋上螞蟻 油倒下去就燒焦\r\n怎麼看怎麼好笑  其實也不壞不好\r\n\r\n生活目前 脫序邊緣  順眼不順眼 \r\n想不想改變\r\n怎樣尖叫 試圖尖叫 都像被噎到\r\n\r\n還是說其實不壞也不好\r\n怎麼逃 都逃脫不了\r\n了不了 料不料的到\r\n世代在變也差不了多少\r\n差不了多少\r\n', '', 253, '', 'NOT YET', 'NOT YET', '', '', '', 0, 1, 0, '2010-09-24 03:25:25', '2015-03-12 13:43:47', '0000-00-00 00:00:00');
